package week1.homeassignments;

public class Fibonacci {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x= 9;
		int y= 0;
		int z= 1;
		int a= 0;
		for(int i=0;i<=x;i++) {
			
			System.out.println(y);
			a=y+z;
			y=z;
			z=a;
			
			
		}

	}

}
